DROP TABLE IF EXISTS `tb_schedules`;
CREATE TABLE `tb_schedules` (
  `schedule_id` int(11) NOT NULL AUTO_INCREMENT,
  `game_id` int(11) NOT NULL COMMENT '赛事id',
  `team_id` varchar(32) NOT NULL COMMENT '球队id(支持多个)',
  `game_date` datetime NOT NULL COMMENT '开始比赛时间',
  `game_duration` double NOT NULL COMMENT '比赛时长',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '比赛状态(0=未开始, 1=正在直播, 2=已结束)',
  `is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '删除(0=正常 1=删除)',
  `schedule_result` varchar(32) DEFAULT NULL COMMENT '比赛结果(让胜\\让平\\让负...)',
  `schedule_grade` varchar(32) DEFAULT NULL COMMENT '比赛成绩(-1.5/2或2-1这种格式)',
  `win_team_id` int(11) DEFAULT NULL COMMENT '胜利方球队id',
  `master_team_id` int(11) DEFAULT '0' COMMENT '主队id',
  `target_team_id` int(11) DEFAULT '0' COMMENT '客队id',
  `is_hot` int(11) DEFAULT '0',
  `cloud_id` int(11) DEFAULT '0',
  `edit_date` datetime DEFAULT NULL,
  `master_red_chess` int(11) DEFAULT '0' COMMENT '主队红牌',
  `master_yellow_chess` int(11) DEFAULT '0' COMMENT '主队黄牌',
  `target_red_chess` int(11) DEFAULT '0' COMMENT '客队红牌',
  `target_yellow_chess` int(11) DEFAULT '0' COMMENT '客队黄牌',
  `target_corner_kick` int(11) DEFAULT '0' COMMENT '客队角球',
  `nami_schedule_id` int(11) DEFAULT '0',
  `master_corner_kick` int(11) DEFAULT '0' COMMENT '主队角球',
  `game_time` varchar(32) DEFAULT NULL COMMENT '时长',
  `category_id` int(11) DEFAULT '0',
  PRIMARY KEY (`schedule_id`),
  UNIQUE KEY `uq_c_model` (`cloud_id`,`nami_schedule_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1726811 DEFAULT CHARSET=utf8 COMMENT='赛程信息表';

